  \"Droplet-Sizing Liquid Water Content Sensor Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 4,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T22:19:37.054267\",\n\t\"name\": \"droplet-sizing-liquid-water-content-sensor-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Icing is a significant aviation hazard,
  and icing conditions continue to be difficult to  precisely forecast or locate in
  real time.  An in-situ sensor, which can be flown coupled with a radiosonde, is
  needed which can both measure supercooled liquid water content in clouds as well
  as characterize the droplet sizes.  This sensor will support the calibration and
  validation of remote-sensing methods used to detect icing conditions, and can also
  be used on its own to support operational meteorology applications.rnAnasphere,
  Inc. proposes to develop a sizing supercooled liquid water content (SSLWC) sonde
  which will meet this need.  It will be based on proven vibrating-wire technology
  which has been used for total water content measurements, but with an altogether
  different physical implementation that will enable droplet sizing.rnPhase I will
  involve the aerodynamic design of the SSLWC sonde, icing tunnel tests demonstrating
  key elements of its function, and a live flight test to gather information on the
  sonde's aerodynamic characteristics.  Phase II will involve further tunnel tests,
  laboratory calibration development, design for manufacturability, and flight tests
  in icing conditions.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
